define({"topics" : [{"title":"Using Additional Threads","shortdesc":"\n                  <p class=\"shortdesc\">When using local caching, you can increase the number of threads that the JDBC Lookup         processor uses to prepopulate\n                     the lookup cache. After the cache is populated, the additional         threads are released. This can substantially increase\n                     the performance of the         processor.\n                  </p>\n               ","href":"datacollector\/UserGuide\/Processors\/JDBCLookup.html#concept_vsl_dvt_d2b","attributes": {"data-id":"concept_vsl_dvt_d2b",},"menu": {"hasChildren":false,},"tocID":"concept_vsl_dvt_d2b-d46e128471","topics":[]},{"title":"Retry Lookups for Missing Values","href":"datacollector\/UserGuide\/Processors\/JDBCLookup.html#concept_xdx_xqq_vcb","attributes": {"data-id":"concept_xdx_xqq_vcb",},"menu": {"hasChildren":false,},"tocID":"concept_xdx_xqq_vcb-d46e128557","topics":[]}]});